import React from "react";
import Header from '../components/Header';
import MainArchive from '../components/MainArchive';
import Footer from '../components/Footer';
const Archive=()=> {
  return (
    <div id="page-wrapper">
      <Header />
      <MainArchive/>
      <Footer />
    </div>
  )
}
export default Archive;
